export default (state = INITIAL_STATE, action) => {
	switch (action.type) {
		case 'SETITEM':
			return {
				...state,
				currentItem: action.payload,
			};
		case 'SETCATEGORY':
			return {
				...state,
				currentCategory: action.payload,
			};
		case 'ADDITEM':
			return {
				...state,
				ads: [...state.ads, action.payload],
			};
	}
	return state;
};
